ws = DATA.readlines.map(&:chomp)

width = ws.first.length
height = ws.length

pats = %w(MSAMS SSAMM MMASS SMASM)

num_found = 0
(0...(height-2)).each do |y|
  (0...(width-2)).each do |x|
    pat = ws[y][x] + ws[y][x+2] + ws[y+1][x+1] + ws[y+2][x] + ws[y+2][x+2] 
    num_found += 1 if pats.include?(pat)
  end
end
p num_found

__END__
